import React, { Component } from "react";
import Header from "../header/header";
import ResumeImg from "../../images/resume";

class Resume extends Component {
  state = {};
  render() {
    return (
      <>
        <Header></Header>
        <img id="resume" src={this.props.project.image5}></img>
      </>
    );
  }
}

export default Resume;
